import React from "react";
import { Component } from 'react';
import { useLocation } from "react-router-dom";

class Temp extends Component {

    hexToInt() {
        var num=parseInt(this.props.prices[0]._hex, 16);
        return num
    }

    render() {
        return (
            <div>
                <h3>관리 임시 페이지입니다.</h3>
                <div>{this.props.names[this.props.id]}
                   
                </div>
                <div>{this.props.descriptions[this.props.id]}
                   
                   </div>
                   <div>{this.hexToInt()}
                   
                   </div>
            </div>
        );
    }
}

export default Temp;



